export default function Sidebar() {
    return (
        <>
            <ul>
                <li><a>CNN</a>Title of News Article</li>
                <li><a>TechCrunch</a>Title of News Article</li>
                <li><a>Medium.com</a>Title of News Article</li>
                <li><a>Businessinsider.com</a>Title of News Article</li>
            </ul>
            <style jsx>{`
                ul {
                    position: relative;
                    margin-block-start: 0;
                    margin-block-end: 0;
                    list-style-type: none;
                    width: 100px;
                    height: calc(100% - 55px);
                    padding: 0px;
                    background-color: #e4e4e4;
                }

                li a {
                    display: block;
                    padding: 16px 16px;
                    color: #000;
                }

                li a:hover {
                    background-color: #555;
                    color: white;
                }
            `}</style>
        </>
    );
}
